Fiz um prato sem carne e não morri!

Quem disse que precisamos comer carne todos os dias, para termos um prato rico e completo?

Não sou vegana, nem vegetariana. Porém, tem dias que não quero comer carne, e está tudo bem. 

Na verdade, se alimentar de um animal deveria ser um ato quase que sagrado. Uma raridade. 
E ao consumi-lo, deveríamos ter respeito por uma vida que deixou de existir, para nos alimentar.

É muito fácil comprarmos um pedaço de carne, muitas das vezes picadinha e sem sangue. Pois temos “nojinho”, não é!? 

Duvido que muitos que estão lendo aqui, conseguiriam matar, limpar e preparar um animal para comer! 
Afinal, não precisamos mais caçar para sobreviver.

Então, da próxima vez que escolher um pedaço de carne para preparar e comer, lembra-se que não veio assim da natureza. Respeite pelo menos. Assim que tenho procurado fazer!

Em resumo, temos “n” variedades alimentícias que vem pronto da natureza, só preparar e comer. Então, por favor, não seja aquela pessoa que diz: - só como se tiver carne. 

