O segredo pro peixe ficar crocante sem soltar aquela água do cozimento é deixar o filé descongelar de um dia para o outro - ou usá-lo fresco. Depois de sair todos os resquícios de água do congelamento, seque o filé em folhas de papel toalha delicadamente para que ele fique sequinho por fora e consigamos empana-lo e dourá-ló sem que solte água em excesso no cozimento. Depois de seco, salpique o sal e a pimenta sobre o peixe, e unte com azeite de oliva até que se espalhe por todo o filé. Após isso, empane na farinha de trigo, passe no ovo batido e em após na farinha panko misturada com as castanhas bem moídas- a farinha panko é feita de pão moído grosso que vai deixar seu peixe super crocante e as castanhas moídas vão dar um toque final maravilhoso no sabor! Depois de empanados os filés, leve-os à uma assadeira untada com azeite de oliva e coloque fatias de pimentão sobre os peixes. Asse em forno pré-aquecido à 200° por aproximadamente 20-30 minutos. Finalize com suco de limão por cima para equilibrar o gostinho do peixe acompanhado do seu vinho Del Piero para aproveite o final de semana! #gastronomia #alimentacaosaudavel #delpiero #peixeempanado";}i:225;a:1:{s:14:"comments_count";i:0;}i:226;a:1:{s:11:"likes_count";i:3;}i:227;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEup5O1ssgm";}i:228;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118746505_131579325328342_3439472259456156843_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=qfk5Nc7QkLIAX8i9wv_&oh=f68df35a1fa6e39cb5f51382d8840e78&oe=5F7DD375";}i:229;a:1:{s:4:"type";s:5:"image";}i:230;a:1:{s:8:"owner_id";i:18898899014;}i:231;a:1:{s:14:"owner_username";s:0:"";}i:232;a:1:{s:14:"owner_fullname";s:0:"";}i:233;a:1:{s:9:"owner_pic";s:0:"";}i:234;a:1:{s:2:"id";s:19:"2391032667331651138";}i:235;a:1:{s:10:"short_code";s:11:"CEup4ruqGZC";}i:236;a:1:{s:12:"created_time";i:1599253327;}i:237;a:1:{s:7:"caption";s:455:"Refeições planejadas ✅⠀
