A cúrcuma longa é um polifenol natural rico em curcumina, tradicionalmente utilizado em países asiáticos como erva medicinal, possuindo propriedade nutracêutica e contribuído no benefício de diversas patologias

Quando falamos de seus benefícios na saúde, podemos destacar sua relevância nas doenças cardiovasculares, doenças neurodegenerativas, câncer, síndrome metabólica, capacidade antioxidante, propriedades anti-inflamatórias e distúrbios neurológicos, hepáticos e respiratórios.

(Mario Pulido-Moran, Jorge Moreno-Fernandez, Cesar Ramirez-Tortosa, and MCarmen Ramirez-Tortosa. Curcumin and Health. Molecules. 2016 Mar; 21(3): 264.)

